import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Grid,
  Card,
  CardContent,
  CardActions,
  CardMedia,
  Chip,
} from '@mui/material';

function DifficultyCard({ title, description, color, points, onSelect, image }) {
  return (
    <Card
      elevation={3}
      sx={{
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
        transition: 'transform 0.2s',
        '&:hover': {
          transform: 'scale(1.02)',
        },
      }}
    >
      <CardMedia
        component="img"
        height="140"
        image={image}
        alt={title}
        sx={{
          objectFit: 'cover',
          borderBottom: 3,
          borderColor: `${color}.main`,
        }}
      />
      <CardContent sx={{ flexGrow: 1, p: 1.5 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 1 }}>
          <Typography variant="h6" component="h3">
            {title}
          </Typography>
          <Chip
            label={`${points} pts/question`}
            color={color}
            size="small"
          />
        </Box>
        <Typography variant="body2" color="text.secondary">
          {description}
        </Typography>
      </CardContent>
      <CardActions sx={{ p: 1 }}>
        <Button
          fullWidth
          variant="contained"
          color={color}
          onClick={onSelect}
          size="small"
        >
          START {title.toUpperCase()} QUIZ
        </Button>
      </CardActions>
    </Card>
  );
}

function FeatureIcon({ icon, label }) {
  return (
    <Box sx={{ textAlign: 'center' }}>
      <Box
        component="img"
        src={icon}
        alt={label}
        sx={{
          width: 24,
          height: 24,
          mb: 0.5,
          filter: 'brightness(0) saturate(100%) invert(27%) sepia(86%) saturate(1882%) hue-rotate(199deg) brightness(96%) contrast(96%)'
        }}
      />
      <Typography variant="subtitle2" sx={{ color: 'primary.main' }}>
        {label}
      </Typography>
    </Box>
  );
}

function Home() {
  const navigate = useNavigate();

  const difficulties = {
    beginner: {
      title: 'Beginner',
      description: 'Learn the basics of cybersecurity. Perfect for those just starting.',
      color: 'success',
      points: 10,
      image: '/images/beginner.jpg'
    },
    intermediate: {
      title: 'Intermediate',
      description: 'Dive deeper into security concepts with challenging questions.',
      color: 'warning',
      points: 20,
      image: '/images/intermediate.jpg'
    },
    advanced: {
      title: 'Advanced',
      description: 'Test your expertise with complex security scenarios.',
      color: 'error',
      points: 30,
      image: '/images/advanced.jpg'
    },
  };

  const features = [
    { icon: '/images/interactive.png', label: 'Interactive' },
    { icon: '/images/badge.png', label: 'Earn Badges' },
    { icon: '/images/mobile.png', label: 'Mobile Ready' }
  ];

  const handleDifficultySelect = (difficulty) => {
    navigate('/quiz', { state: { difficulty } });
  };

  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        height: '100%',
        gap: 2,
      }}
    >
      <Box sx={{ mb: 1 }}>
        <Typography
          variant="h1"
          component="h1"
          align="center"
          sx={{
            color: 'primary.main',
            fontWeight: 'bold',
            mb: 1,
          }}
        >
          CyberQuiz
        </Typography>

        <Typography
          variant="h5"
          component="h2"
          align="center"
          sx={{
            maxWidth: 'sm',
            mx: 'auto',
            fontSize: { xs: '1rem', sm: '1.25rem' },
          }}
        >
          Test your cybersecurity knowledge and earn badges
        </Typography>
      </Box>

      <Grid container spacing={2} sx={{ flex: 1 }}>
        {Object.entries(difficulties).map(([key, difficulty]) => (
          <Grid item xs={12} sm={4} key={key}>
            <DifficultyCard
              {...difficulty}
              onSelect={() => handleDifficultySelect(key)}
            />
          </Grid>
        ))}
      </Grid>

      <Grid 
        container 
        spacing={3} 
        sx={{ 
          mt: 'auto',
          mb: 1,
          justifyContent: 'center',
        }}
      >
        {features.map((feature, index) => (
          <Grid item xs={4} sm={4} md={4} key={index}>
            <FeatureIcon {...feature} />
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}

export default Home;
